import{_ as a,c as o,o as i,ae as s}from"./chunks/framework.Dh1jimFm.js";const p=JSON.parse('{"title":"Projetos Realizados e Habilidades Adquiridas","description":"","frontmatter":{},"headers":[],"relativePath":"github.md","filePath":"github.md"}'),t={name:"github.md"};function r(n,e,l,d,u,c){return i(),o("div",null,e[0]||(e[0]=[s('<h1 id="projetos-realizados-e-habilidades-adquiridas" tabindex="-1">Projetos Realizados e Habilidades Adquiridas <a class="header-anchor" href="#projetos-realizados-e-habilidades-adquiridas" aria-label="Permalink to &quot;Projetos Realizados e Habilidades Adquiridas&quot;">​</a></h1><p><strong>Versão:</strong> 1.0<br><strong>Data de Criação:</strong> 16/09/2025</p><h2 id="_1-objetivo" tabindex="-1">1. Objetivo <a class="header-anchor" href="#_1-objetivo" aria-label="Permalink to &quot;1. Objetivo&quot;">​</a></h2><p>Neste módulo, apresento alguns dos projetos nos quais atuei, destacando as habilidades técnicas e colaborativas desenvolvidas e aplicadas ao longo do processo.</p><h2 id="projetos" tabindex="-1">Projetos <a class="header-anchor" href="#projetos" aria-label="Permalink to &quot;Projetos&quot;">​</a></h2><ul><li><strong>Transmission Line</strong></li><li><strong>LT-Dev</strong></li><li><strong>Tucuy Development</strong></li></ul><h2 id="_3-1-transmission-line" tabindex="-1">3.1 Transmission Line <a class="header-anchor" href="#_3-1-transmission-line" aria-label="Permalink to &quot;3.1 Transmission Line&quot;">​</a></h2><ul><li>Esse foi meu primeiro projeto na empresa, onde adquiri conhecimento em uma linguagem desafiadora: <strong>Visual Basic</strong>, que atualmente não é tão comum.</li><li>Com o passar dos meses, desenvolvi um interesse genuíno pela linguagem.</li><li>Nesse projeto, também aprimorei meus conhecimentos técnicos em <strong>VBA, Macros e Engenharia Elétrica</strong>.</li></ul><p><em>(// adicionar foto)</em></p><h2 id="_3-2-lt-dev" tabindex="-1">3.2 LT-Dev <a class="header-anchor" href="#_3-2-lt-dev" aria-label="Permalink to &quot;3.2 LT-Dev&quot;">​</a></h2><p>Projeto voltado para o desenvolvimento de um sistema de <strong>realidade mista (XR)</strong>, acessado por meio de óculos inteligentes. Ele permite que o engenheiro tenha uma experiência imersiva, visualizando cenários em 3D e realizando cálculos de áreas diretamente no ambiente virtual.</p><h3 id="principais-estudos-e-praticas" tabindex="-1">Principais estudos e práticas <a class="header-anchor" href="#principais-estudos-e-praticas" aria-label="Permalink to &quot;Principais estudos e práticas&quot;">​</a></h3><h4 id="unity" tabindex="-1">Unity <a class="header-anchor" href="#unity" aria-label="Permalink to &quot;Unity&quot;">​</a></h4><ul><li>Criação de interfaces.</li><li>Simulação de fatores físicos no ambiente 3D.</li><li>Reconhecimento de objetos.</li><li>Demonstração de estudos elétricos (ex.: dilatação de cabos com pontos iniciais e finais que se ajustavam conforme eram alterados).</li><li>Criação de terrenos e cenários.</li><li>Conversão de objetos reais para o ambiente virtual.</li><li>Integração do sistema em dispositivos móveis.</li></ul><p><em>(// adicionar foto)</em></p><h4 id="colmap" tabindex="-1">Colmap <a class="header-anchor" href="#colmap" aria-label="Permalink to &quot;Colmap&quot;">​</a></h4><ul><li>Geração de malhas de pontos para manipulação de imagens.</li><li>Desenvolvimento de um <strong>código em Python</strong> que recebia uma imagem, processava a malha de pontos no Colmap, fazia a limpeza e validava coordenadas (x, y, z), prevenindo erros.</li></ul><p><em>(// adicionar imagem)</em></p><h4 id="meshlab" tabindex="-1">MeshLab <a class="header-anchor" href="#meshlab" aria-label="Permalink to &quot;MeshLab&quot;">​</a></h4><ul><li>Manipulação de malhas geradas, adicionando cores, texturas e ajustes.</li><li>Criação de representações 3D detalhadas, possibilitando exportação para softwares como Unity.</li><li>Uso dessas malhas em aplicações de realidade mista para futuros projetos.</li></ul><h2 id="_3-3-tucuyqqahuac" tabindex="-1">3.3 TucuyQqahuac <a class="header-anchor" href="#_3-3-tucuyqqahuac" aria-label="Permalink to &quot;3.3 TucuyQqahuac&quot;">​</a></h2><p>Projeto atual em que atuo, focado na criação de um <strong>sistema de gestão</strong> para usuários que precisam registrar digitalmente livros e arquivos.</p><h3 id="contribuicoes-no-back-end" tabindex="-1">Contribuições no Back-End <a class="header-anchor" href="#contribuicoes-no-back-end" aria-label="Permalink to &quot;Contribuições no Back-End&quot;">​</a></h3><ul><li>Implementação de <strong>autenticação com JWT</strong>.</li><li>Criação de múltiplos <strong>endpoints</strong> (models, controllers, services, repositories).</li><li>Uso de <strong>Docker</strong> para conteinerização.</li><li>Integração e gerenciamento de <strong>banco de dados</strong>.</li><li>Aplicação da metodologia <strong>TDD (Test-Driven Development)</strong>.</li><li>Implementação de <strong>Soft Delete</strong>.</li><li>Colaboração utilizando <strong>Git</strong>.</li></ul><p><em>(// adicionar foto)</em></p><h3 id="contribuicoes-no-front-end" tabindex="-1">Contribuições no Front-End <a class="header-anchor" href="#contribuicoes-no-front-end" aria-label="Permalink to &quot;Contribuições no Front-End&quot;">​</a></h3><ul><li>Criação de protótipos funcionais.</li><li>Integração com autenticação via <strong>HttpOnly Token</strong>.</li><li>Desenvolvimento da <strong>página de buscas</strong>.</li><li>Desenvolvimento da <strong>página de eventos</strong>.</li></ul><p><em>(// adicionar fotos)</em></p>',28)]))}const h=a(t,[["render",r]]);export{p as __pageData,h as default};
